import React from "react";



function App(props) {
  return (
    <div className="App">
      <h1>References</h1>
      {props.references.map((reference, index) => {
        return (
          <div key={index}>
            <h2>{reference.title}</h2>
            <p>{reference.link}</p>
          </div>
        );
      })}
    </div>
  );
}

export default App;
